#include<stdio.h>
#include<stdlib.h>
#include<string.h>
#include<time.h>
#include<sys/time.h>
#include<pcre.h>

#define VECTORSIZE (65536*3)

double regex(const char* str, char* pat){
  double alltime = 0;
  int i;
  pcre *re;
  const char* errStr;
  int errOffset;
  int matched;
  int ovector[VECTORSIZE];
  pcre_extra *extra;
  pcre_jit_stack *jit_stack;
  struct timeval start_timeval, end_timeval;
  double sec_all  = 0;
  void *conf;

  conf = malloc(32);

  gettimeofday(&start_timeval, NULL);
  re = pcre_compile(pat, 0, &errStr, &errOffset, NULL);
  if(errStr != NULL) {
    fprintf(stderr, "compile error: %s", errStr);
    return;
  }

  extra = pcre_study(re, PCRE_STUDY_JIT_COMPILE, &errStr);
  if(errStr != NULL) {
    fprintf(stderr, "study error: %s", errStr);
    return;
  }
  jit_stack = pcre_jit_stack_alloc(4096*1024, 65536*1024);
  pcre_assign_jit_stack(extra, NULL, jit_stack);

  for(i = 0; i < 50000; i++){

    if(re == NULL){
      fprintf(stderr, "matching error: %s", errStr);
      return;
    }else{
      matched = pcre_exec(re, extra, str, strlen(str), 0, 0, ovector, VECTORSIZE);

      if(matched >= 0) {
        printf("P, ");
      }else {
        printf("F, ");
      }
    }
    gettimeofday(&end_timeval, NULL);

    sec_all += ((end_timeval.tv_sec - start_timeval.tv_sec) + (end_timeval.tv_usec - start_timeval.tv_usec) / 1000000.0);

  }
  printf("\n");
  pcre_free(re);
  pcre_free_study(extra);
  pcre_jit_stack_free(jit_stack);

  return (sec_all / 50000) * 1000;
}

